import React from 'react'

const DisplayPokemon = (props) =>{
    return(
        <div>
            <ul>
                {props.map((pokemon) =>(
                    <li>
                        {props.pokemon.name}
                    </li>

                ))}

            </ul>




        </div>
    );
};

export default DisplayPokemon
